import React from "react";
import PropTypes from "prop-types";
import "antd/dist/reset.css";
import "./index.css";

const App = ({ Component }) => {
  return <Component />;
};

App.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
